import React from "react";
import {TrainProps} from "./TrainProps";
import {time} from "ionicons/icons";

interface TrainPropsExt extends TrainProps{
    onBuy: (id?: string) => void;
}

const Train: React.FC<TrainPropsExt> = ({id, from, to, timeLeave, timeArrive, nrSeats}) =>{
    return(
        <li>
            <label>From: {from}  -  To: {to}  -  Seats: {nrSeats}</label>
        </li>
    );
};

export const TrainDetails: React.FC<TrainProps> = ({id, from, to, timeLeave, timeArrive, nrSeats}) =>{
    return(
      <li>
          <label>From: {from}  -  To: {to}  -  Seats: {nrSeats}</label>
          <label>Leaves: {timeLeave}</label>
          <label>Arrives: {timeArrive}</label>
      </li>
    );
}

export default Train;
